import React from "react";
import { Button } from "@material-ui/core";

function SecondStep({ onGoBack }) {
  return (
    <div>
      <h1>Welcome to the second step!</h1>
      <Button variant="contained" color="default" onClick={onGoBack}>Go Back to First Step</Button>
    </div>
  );
}

export default SecondStep;
